import React from 'react'
import SectionHeader from '../Components/SectionHeader'
import Contact from '../Components/Contact'
import { Link } from 'react-router-dom'

export default function PageNotFound() {

  const YouTubeVideo = () => {
    const videoId = 'r5_NvFTfAWc';

    const opts = {
      height: '390',
      width: '640',
      playerVars: {
        autoplay: 0,
      },
    };

    return <YouTube videoId={videoId} opts={opts} />;
  };

  return (
    <section className="section-container" id="user-lost" >

  <SectionHeader description={"01 / 02 | 404 Not Found"} title="It looks like you are lost" />
        <div className="content-container" style = { { height: '50vh', justifyContent: 'center'}}>
          <p>Do not worry, you will be shortly redirected to the homepage. In case you are not, click <Link to="/">here</Link>.</p>
          <p>In the meanwhile, enjoy this video:</p>
          {YouTubeVideo()}
        </div>

    </section>
  )
}
